import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import Footers from "../components/Footers";
import "../css_styles/DetailProductivity.css";
import ProductivityDetail from "../components/ProductivityDetail";
import { useParams } from "react-router-dom";

import { resellerDetailAction } from "../actions/advertiseActions2";
import Loaders from "../components/Loader";
import ErrorMessage from "../components/ErrorMessage";

const ResellerDetail = ({ match, history, location }) => {
    const params = useParams();
    const {id, slug} = params;


    const dispatch = useDispatch();
    const resellerDetail = useSelector((state) => state.resellerDetail);

    const {
      error: detailResellerError,
      loading: detailResellerLoading,
      reseller : detailReseller,
    } = resellerDetail;

    useEffect(() => {
      dispatch(resellerDetailAction(id, ));
    }, [dispatch]);

    return (
      <div>
        <div className="productivity_main">
          <div className="productivity_advertise"></div>
          {detailResellerLoading ? (
            <Loaders />
          ) : detailResellerError ? (
            <ErrorMessage type="error" error={detailResellerError} />
          ) : (
            <div className="productivity_cards">
              <ProductivityDetail tech={detailReseller} model={"Reseller"} />
            </div>
          )}
          <div className="productivity_advertise">
            {/* <Advertise tech={techs} /> */}
          </div>
        </div>

        <Footers />
      </div>
    );
  };

export default ResellerDetail;
